import React, { useEffect, useState } from "react";

interface InfoProps{
  data: any;
  error: any;
}

const Info: React.FC<InfoProps> = ({data, error}) => {
  return (
    <div style={{ padding: "1rem" }}>
      <h2>Weather Info</h2>

      {error && <p style={{ color: "red" }}>Error: {error}</p>}
      {!error && !data && <p>Loading...</p>}

      {data && (
        <pre
          style={{
            background: "#f4f4f4",
            padding: "10px",
            borderRadius: "8px",
            overflowX: "auto",
          }}
        >
          {JSON.stringify(data, null, 2)}
        </pre>
      )}
    </div>
  );
};

export default Info;
